import React, { useState,useEffect } from 'react';

const data={

}

function OfficesCard(iconURL,title,content){
    return(

    <div class="row">
            <div class="col-md-4 mb-8">
                <div class="d-flex flex-column bg-white rounded sw-rounded p-5 text-center position-relative">
                <figure class="mb-4 d-none">
                    <img srcset="https://www.saleswhale.com/hubfs/humpback/web/assets/img/sw/sw-cusw-2.png 320w, https://www.saleswhale.com/hubfs/humpback/web/assets/img/sw/sw-cusw-2.png 480w, https://www.saleswhale.com/hubfs/humpback/web/assets/img/sw/sw-cusw-2.png 600w" src="https://www.saleswhale.com/hs-fs/hubfs/humpback/web/assets/img/sw/sw-cusw-2.png?width=136&amp;name=sw-cusw-2.png" alt="Image re-engage stale leads" width="136" class=""/>
                </figure>
                <h3 class="sw-heading-alt sw-heading-alt-2 mb-2">Go beyond lead scoring</h3>
                <p class="mb-md-0">Saleswhale helps to engage leads that are not immediately actioned by the sales team - engaging them in two-way conversation to sniff out if they are ready to buy.</p>
                <div class="sw-shapes-position sw-shapes-position--tl sw-shapes-bubble-3 d-none d-md-block"></div>
                </div>

            </div>
        </div>

    )

}


export default function Offices(){
    //component state for data
    const [info,setInfo]=useState(null);

    //set state based on server response
    useEffect(()=>{
        setInfo(data)
    },[])



    return(
        <section class="sw-bg-wave">
            <div class="container">
                <div id="hs_cos_wrapper_how-customers-using-header" class="hs_cos_wrapper hs_cos_wrapper_widget hs_cos_wrapper_type_module" style="" data-hs-cos-general-type="widget" data-hs-cos-type="module">
                <header class="px-lg-4 text-center">
                    <h2 class=" sw-title u-space-2-top text-center mb-lg-9">
                        How our customers are using Saleswhale
                    </h2>
                </header>
            </div>
            </div>
        </section>
    )
}
